//Footer componenet with active links
import Link from "next/link";

const Footer = () => (
  <div className="nav">
    <p>AllSound Visual</p>
    <Link href="https://github.com/T4lith4/">
      <a className="icon-link">
        <img
          className="icon"
          alt="github icon"
          src="/static/images/github.png"
        ></img>
      </a>
    </Link>

    <a
      href="mailto:francoiscoetzee@rocketmail.com?Subject=Dear%20AllSoundVisual"
      target="_top"
      className="icon-link"
    >
      {`Remember to disable Anchor tag styles`}
      <i class="fas fa-envelope-square"></i>
    </a>
    <p>
      {" "}
      <i class="fab fa-facebook-square"></i>
    </p>
    <p>
      {" "}
      <i class="fas fa-phone-square"></i>
    </p>

    <style jsx>{`
      .nav {
        background: darkgrey;
        font-size: 25px;
        font-family: calibri;
        display: flex;
        justify-content: center;
        padding: 10px;
        width: 100%;

        position: absolute;
        bottom: 0;
      }
      .linkedin {
        width: 35px;
      }
      img {
        width: 35px;
        margin-left: 50px;
      }
    `}</style>
  </div>
);

export default Footer;
